text.paragraph:
QULIPTA is contraindicated in patients with a history of hypersensitivity to atogepant or any of the components of QULIPTA. Reactions have included anaphylaxis and dyspnea [see Warnings and Precautions (

                        5.1

                     )].

Hypersensitivity reactions, including anaphylaxis, dyspnea, rash, pruritus, urticaria, and facial edema, have been reported with use of QULIPTA [see Adverse Reactions (

                              6.2

                           )]. Hypersensitivity reactions can occur days after administration. If a hypersensitivity reaction occurs, discontinue QULIPTA and institute appropriate therapy [see Contraindications (

                              4

                           )].

