text.paragraph:
In the 12-week, placebo-controlled clinical studies (Studies 1, 2, and 3), 314 patients received at least one dose of QULIPTA 10 mg once daily, 411 patients received at least one dose of QULIPTA 30 mg once daily, 678 patients received at least one dose of QULIPTA 60 mg once daily, and 663 patients received placebo [see 
                           Clinical Studies (

                              14

                           )
                           ]. Approximately 88% were female, 75% were White, 13% were Black, 10% were Asian, and 10% were of Hispanic or Latino ethnicity. The mean age at study entry was 41 years (range 18 to 74 years).

Immune System Disorders: Hypersensitivity (e.g., anaphylaxis, dyspnea, rash, pruritus, urticaria, facial edema) [see Contraindications (

   4

) and Warnings and Precautions (

   5.1

)]

Vascular Disorders: Hypertension [see Warnings and Precautions (

   5.2

)], Raynaud’s phenomenon [see Warnings and Precautions (

   5.3

)]

Coadministration of QULIPTA with itraconazole, a strong CYP3A4 inhibitor, resulted in a significant increase in exposure of atogepant in healthy subjects [see Clinical Pharmacology (

                              12.3

                           )]. For episodic migraine, the recommended dosage of QULIPTA with concomitant use of strong CYP3A4 inhibitors is 10 mg once daily. For chronic migraine, avoid concomitant use of strong CYP3A4 inhibitors with QULIPTA [see Dosage and Administration
                            (

                              2.2

                           )
                           ]. No dosage adjustment of QULIPTA is needed with concomitant use of moderate or weak CYP3A4 inhibitors.

Coadministration of QULIPTA with steady state rifampin, a strong CYP3A4 inducer, resulted in a significant decrease in exposure of atogepant in healthy subjects [see Clinical Pharmacology (
12.3
)]. Concomitant administration of QULIPTA with moderate inducers of CYP3A4 can also result in decreased exposure of atogepant. Coadministration of QULIPTA with steady-state topiramate, a weak CYP3A4 inducer, resulted in decreased exposure of atogepant in healthy subjects [see Clinical Phar macology (
12.3
)].

For episodic migraine, the recommended dosage of QULIPTA with concomitant use of strong, moderate, or weak CYP3A4 inducers is 30 mg or 60 mg once daily [see Dosage and Administration
                            (

                              2.2

                           )
                           ].

For chronic migraine, avoid concomitant use of strong, moderate, or weak CYP3A4 inducers with QULIPTA [see Dosage and Administration
                            (

                              2.2

                           )
                           ].

Coadministration of QULIPTA with single dose rifampin, an OATP inhibitor, resulted in a significant increase in exposure of atogepant in healthy subjects [see Clinical Pharmacology (

                              12.3

                           )]. For episodic migraine, the recommended dosage of QULIPTA with concomitant use of OATP inhibitors is 10 mg or 30 mg once daily. For chronic migraine, the recommended dosage of QULIPTA with concomitant use of OATP inhibitors is 30 mg once daily [see Dosage and Administration
                            (

                              2.2

                           )
                           ].

There are no adequate data on the developmental risk associated with the use of QULIPTA in pregnant women. In animal studies, oral administration of atogepant during the period of organogenesis (rats and rabbits) or throughout pregnancy and lactation (rats) resulted in adverse developmental effects (decreased fetal and offspring body weight in rats; increased incidence of fetal structural variations in rabbits) at exposures greater than those used clinically [see 
                           Data
                           ].

The renal route of elimination plays a minor role in the clearance of atogepant [see Clinical Pharmacology 
                           (

                              12.3

                           )]. For episodic migraine, in patients with severe renal impairment (CLcr 15-29 mL/min) and in patients with end-stage renal disease (ESRD) (CLcr <15 mL/min), the recommended dosage of QULIPTA is 10 mg once daily; in patients with ESRD undergoing intermittent dialysis, QULIPTA should preferably be taken after dialysis [see Dosage and Administration
                            (

                              2.2

                           )
                           ]. For chronic migraine, avoid use of QULIPTA in patients with severe renal impairment and in patients with ESRD. No dose adjustment is recommended for patients with mild or moderate renal impairment.

No dose adjustment of QULIPTA is recommended for patients with mild or moderate hepatic impairment. Avoid use of QULIPTA in patients with severe hepatic impairment [see Adverse Reactions (
6.1
) and Clinical Pharmacology (
12.3
)].

The renal route of elimination plays a minor role in the clearance of atogepant. Based on a population pharmacokinetic analysis, there is no significant difference in the pharmacokinetics of atogepant in patients with mild or moderate renal impairment (CLcr 30-89 mL/min) relative to those with normal renal function (CLcr >90 mL/min). Patients with severe renal impairment or end-stage renal disease (ESRD; CLcr <30 mL/min) have not been studied [see Dosage and Administration
                            (

                              2.2

                           )
                            and Use in Specific Populations (

                              8.6

                           )
                           ].

In patients with pre-existing mild (Child-Pugh Class A), moderate (Child-Pugh Class B), or severe (Child-Pugh Class C) hepatic impairment, the total atogepant exposure was increased by 24%, 15%, and 38%, respectively. Due to a potential for liver injury in patients with severe hepatic impairment, avoid use of QULIPTA in patients with severe hepatic impairment [see Use in Specific Populations (

                              8.7

                           )].

Atogepant is a substrate of P-gp, BCRP, OATP1B1, OATP1B3, and OAT1. Dose adjustment for concomitant use of QULIPTA with inhibitors of OATP is recommended based on a clinical interaction study with a OATP inhibitor [see Dosage and Administration (

                              2.2

                           )].

Co-administration of QULIPTA with itraconazole, a strong CYP3A4 inhibitor, resulted in a clinically significant increase (Cmax by 2.15-fold and AUC by 5.5-fold) in the exposure of atogepant in healthy subjects [see Drug Interactions (

                              7.1

                           )].

Co-administration of QULIPTA with rifampin, a strong CYP3A4 inducer, decreased atogepant AUC by 60% and Cmax by 30% in healthy subjects [see Drug Interactions (

                              7.2

                           )]. No dedicated drug interaction studies were conducted to assess concomitant use with moderate CYP3A4 inducers. Moderate inducers of CYP3A4 can decrease atogepant exposure [see Drug Interactions (

                              7.2

                           )].  Co-administration of QULIPTA with topiramate, a weak inducer of CYP3A4, decreased atogepant mean steady-state AUC 0-τ by 25% and mean steady-state Cmax by 24% in healthy subjects [
                           see Drug Interactions (

                              7.2

                           )
                           ].

Co-administration of QULIPTA with single dose rifampin, an OATP inhibitor, increased atogepant AUC by 2.85-fold and Cmax by 2.23-fold in healthy subjects [see Drug Interactions (

                              7.3

                           )].

Inform patients about the signs and symptoms of hypersensitivity reactions and that these reactions can occur with QULIPTA. Advise patients to discontinue QULIPTA and seek immediate medical attention if they experience any symptoms of a hypersensitivity reaction [see Warnings and Precautions (

                        5.1

                     )].

Inform patients that hypertension can develop or pre-existing hypertension can worsen with QULIPTA, and that they should contact their healthcare providers if they experience elevation in their blood pressure [see Warnings and Precautions (

                        5.2

                     )].

Inform patients that Raynaud’s phenomenon can develop or worsen with QULIPTA. Advise patients to discontinue QULIPTA and contact their healthcare provider if they experience signs or symptoms of Raynaud’s phenomenon [see Warnings and Precautions (

                        5.3

                     )].
